import React from "react";
const APP=()=>
{
const yet={
        border: '4px',
        borderColor: 'red',
        borderStyle: 'dashed'
    }

    return(
        <>
        <><yet/><p style={{
        color: 'blue', backgroundColor: 'green',
        textTransform: 'uppercase'
    }}>
        Hello there!
    </p></>
   </>
)
    }
export default App;
